import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";

function App() {
    return <Card />;
}

function Card() {
    return (
        <div className="card">
            <Avatar />
            <Content />
            <Skillset lang="HTML" color="red" />
            <Skillset lang="CSS" color="red" />
        </div>
    );
}

function Avatar() {
    return <img src="./assets/image/dd.jpg" alt="" />;
}

function Content() {
    return (
        <div>
            <div className="flex">
                <h2>Jwala baheliya</h2>
                <h3 style={{ fontStyle: "italic" }}>Frontend Developer</h3>
            </div>
            <p>
                Lorem ipsum dolor sit amet consectetur adipisicing elit. A
                expedita dicta laboriosam sapiente delectus possimus ab
                praesentium tempore sequi repellat. Exercitationem recusandae
                quam eaque sed fuga ipsa dicta nostrum fugiat!
            </p>
        </div>
    );
}

function Skillset(props) {
    return (
        <ul>
            <li style={{ color: props.color }}>{props.lang}</li>
        </ul>
    );
}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
    <React.StrictMode>
        <App />
    </React.StrictMode>
);
